import React from "react";
import Form from "./components/Form";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time: 0
    }
  }

  render() {
    return (
      <>
        <h1>Time: {this.state.time}</h1>
        <button onClick={this.start}>Start</button>
        <button onClick={this.stop}>Stop</button>
      </>
    )
  }
}

export default App;
